import { Container, Text } from "../styledComponents";
import styled from "styled-components";

const ImgWrapper = styled(Container)`
  flex-direction: row;
  align-items: center;
  flex
  justify-content: center;
  background-color: ${({ theme }) => theme.btnPrimary};
  min-height: 100%;
  max-height: 100%;
`;

const Login = () => {
  return (
    <Container
      flex={1}
      color="red"
      row
      customStyles={{ minHeight: "100vh", maxHeight: "100vh" }}
    >
      <ImgWrapper>
        <Text>Image</Text>
      </ImgWrapper>
      <Container
        flex={0.35}
        row
        middle
        center
        customStyles={{ minHeight: "100%", maxHeight: "100%" }}
      >
        <Text>forms</Text>
      </Container>
    </Container>
  );
};

export default Login;
